import React, {useEffect} from 'react'

function FetchApi() {
    
    const [details, setdetails] = useState()
    useEffect(() => {
        fetch('https://randomuser.me/api/?results=10')
        .then((info)=>{
            info.json().then((details)=>{
                console.log(details);

            })
        })
    }, [])
    

  return (
    <div>FetchApi</div>
  )
}

export default FetchApi
